/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground } from 'docz'
import SideMenu from 'rk-admin-ui/es/side-menu';
import menus from '../components/menu-data';
import { BrowserRouter } from 'react-router-dom';

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "sidemenu"
    }}>{`SideMenu`}</h1>
    <p>{`Menu list of Navigation.`}</p>
    <h2 {...{
      "id": "properties"
    }}>{`Properties`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Property`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Type`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Default`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`collapsed`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`to set the current status`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`defaultOpenKeys`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`array with the keys of default opened sub menus`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(collapsed, type) => {}`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`isMobile`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`to set current status of screen`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`false`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`defaultSelectedKeys`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`array with the keys of default selected menu items`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(collapsed, type) => {}`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`onCollapse`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`the callback function, executed by clicking the trigger or activating the responsive layout`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`(collapsed, type) => {}`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "usage"
    }}>{`Usage`}</h2>
    <Playground __position={0} __code={'<BrowserRouter>\n  <SideMenu logoType=\"text\" logo=\"SAAS CMS\" menus={menus} />\n</BrowserRouter>'} __scope={{
      props: this ? this.props : props,
      Playground,
      SideMenu,
      menus,
      BrowserRouter
    }} mdxType="Playground">
    <BrowserRouter mdxType="BrowserRouter">
        <SideMenu logoType='text' logo='SAAS CMS' menus={menus} mdxType="SideMenu" />
    </BrowserRouter>
    </Playground>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
